column8:
太陽光を乱反射させて室内を彩る<br />
サンキャッチャー用パーツです。<br />
ワイヤーとカシメ玉、他装飾パーツを使って<br />
オリジナルのサンキャッチャーが作れます。<br />
<br />
■素材：ガラス<br />
